import { configureStore } from "@reduxjs/toolkit";
import { scrapReducer } from "../reducer/Reducer";

console.log(scrapReducer,"scrapReducer")

 const Store = configureStore({
  reducer: {
    ScrapReducer: scrapReducer,
  },
});
export default Store
